import pytest
from httpx import AsyncClient
from api2last import app  # Importer votre application FastAPI depuis api2last.py

@pytest.mark.asyncio
async def test_process_base64():
    async with AsyncClient(app=app, base_url="http://0.0.0.0:8001") as client:
        # Test avec des données base64 valides
        data = {"base64_data": ''}
        response = await client.post("/process_base64", json=data)
        assert response.status_code == 200
        assert response.json()["result"] == "ko"  # Vérifiez le résultat attendu

